import React from 'react'
import { withStyles,makeStyles,CssBaseline , ThemeProvider, createMuiTheme} from '@material-ui/core'
import PageHeader from './PageHeader';
import AddIcon from '@material-ui/icons/Add';

const theme = createMuiTheme( {
    palette: {
        primary:{
            main: '#333996',
            light: '#3c44b126'
        },
        secondary: {
            main: '#f83245',
            light: '#f8324526'
        },
        background: {
            default: '#fffff'
        },
    },
    overrides: {
        MuiAppBar: {
            root: {
                transform: 'translateZ(0)'
            }
        }
    } 
})
const style = {
    sideMenu: {
        display: 'flex',
        flexDirection: 'column',
        position: 'absolute',
        left: '0px',
        width: '320px',
        height: '100%',
        backgroundColor: '#253053'
    }
}

const SideMenu = (props) => {

    const { classes } = props
    return (

        <ThemeProvider theme={theme}>
        <div className={classes.sideMenu}>
            <div>
                <PageHeader
                    title="User"
                    icon={<AddIcon/>}
                    />
                <PageHeader
                    title="Team"
                    icon={<AddIcon fontSize="large"/>}
                    />
                </div>
        </div>

        </ThemeProvider>

    )
}
export default withStyles(style)(SideMenu)
